/**
 * Enable additional form effect
 */
$(function(){"use strict";$(".input-field").each(function(){var a=$(this);""!==$.trim(a.val())&&a.parent().addClass("input-filled"),a.focus(function(){$(this).parent().addClass("input-filled")}),a.blur(function(){var a=$(this);""===$.trim(a.val())&&a.parent().removeClass("input-filled")})})});